  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0109914 includes discrete
  sample and profile data collected from NOAA Ship RONALD H. BROWN in the South Atlantic
  Ocean from 2011-09-26 to 2011-10-31. These data include AIR-SEA DIFFERENCE - PARTIAL
  PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DELTA CARBON-13,
  DELTA CARBON-14, DISSOLVED INORGANIC CARBON (DIC), DISSOLVED ORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, Partial pressure (or fugacity) of
  carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide -
  water, Potential temperature (theta), SALINITY, SEA SURFACE TEMPERATURE, SULFUR
  HEXAFLUORIDE (SF6), TOTAL ALKALINITY (TA), Total Dissolved Nitrogen (TDN), WATER
  TEMPERATURE, pH, phosphate and silicate. The instruments used to collect these data
  include Alkalinity titrator, CTD, Coulometer for DIC measurement, bottle and pH
  sensors.nnThese data were collected by Frank J. Millero of Rosenstiel School of
  Marine and Atmospheric Science, Dr. Rik H. Wanninkhof of US DOC; NOAA; OAR; Atlantic
  Oceanographic and Meteorological Laboratory, Richard A. Feely of US DOC; NOAA; OAR;
  Pacific Marine Environmental Laboratory and Craig A. Carlson of University of California
  - Santa Barbara as part of the CLIVAR_A10_2011 data set. CDIAC associated the following
  cruise ID(s) with this data set: CLIVAR_A10_2011nnThe International CLIVAR Global
  Ocean Carbon and Repeat Hydrography Program carries out a systematic and global
  re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes in
  storage and transport of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
